import React from "react";
import Radio from "../../../components/radio/Radio";
import Nav from "../../../components/nav/Nav";
import Button from "../../../components/button/Button";


const Level=()=>{


    return(
        <div className="container-box">
            What is your highest level of education?
            <Radio name="highSchool" label="High School" checked={true} />
            <Radio name="bachelors" label="Bachelors"/>
            <Radio name="masters" label="Masters"/>
            <Radio name="doctorate" label="doctorate"/>
            <Button className="signupBtn" label="Next"/>
            <Nav pageName="home"/>
        </div>
    )
}

export default Level;
